import React, {useState, useEffect} from "react";
import { UserRegister } from "../Service/Api";



export default function Home(){
  const [carSale, setCarSale ] = useState([])

  useEffect(()=>{
   UserRegister()
    .then(
      (response)=>{
        const dados = response.data
        setCarSale(dados)
      }
    )
    .catch((error)=>{
      console.log(error)
    }
    )

  },[])
  console.log(carSale)
  return(
    <h1>Hello World!</h1>
  )
}
